INSERT INTO public.observations VALUES (269, 4, 4, false, 17, 'Deficiencias en la ejecución y conclusión de los trabajos.', 1, '2020-04-17 23:06:45.419209+00', 0, 4, 4, '2020-04-17 23:06:45.419209+00', '2018-10-15', '2018-10-01', '2018-09-24', '2018-10-15', '2018-10-15', 'CTG-DCAOP-0448/2018', '1.0-0935/2018', 'NO APLICA', 'El Municipio informa que adjunta la siguiente documentación:   “Se anexa material fotográfico de obra observada.”', 'En su respuesta el Municipio presenta un registro fotográfico donde se muestran las reparaciones realizadas a la obra.  Al respecto, se realizó verificación correspondiente, comprobando que algunas de las deficiencias señaladas fueron corregidas, sin embargo, no se atendió el total de las fallas señaladas en la Cédula de Inspección de Campo, lo cual se hizo constar en Registro Auxiliar de Observaciones de fecha 22 de octubre de 2018. Por consiguiente, la observación se determina NO SOLVENTADA.', 3, 'CTG-OP-18-072', '2020-03-26', '2020-04-28', '2020-03-26', 1);
